			["displayText"] = "%c",
			["customText"] = "function()\n    local s = \"Interrupts\"\n    \n    \n    if WA_INTERRUPT_SUCCESS then\n        s = \"|cFF32cd32\" .. WA_INTERRUPT_NAME .. \" - \" .. WA_INTERRUPT_SPELL \n        \n        --uncomment to show target & the interrupted spell\n        --s = s .. \"\\n\" .. WA_INTERRUPT_TARGET .. \"'s [\" .. WA_INTERRUPT_TARGETSPELL .. \"]\"\n        \n        \n    elseif WA_INTERRUPT_SPELL then\n        s =  \"|cFFff8c00\" .. WA_INTERRUPT_NAME .. \" - \" .. WA_INTERRUPT_SPELL\n    end\n    \n    \n    \n    return s\nend",
