				["names"] = {
				},
				["unit"] = "player",
				["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
				["subeventSuffix"] = "_CAST_START",
				["spellIds"] = {
				},
				["custom"] = "function(event, timeStamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellId, spellName, spellSchool, extraSpellID, extraSpellName, extraSchool)\n    \n    WA_INTERRUPT_NAME = \"Bubax\" --change this :3\n    \n    WA_INTERRUPT_SPELLS = WA_INTERRUPT_SPELLS or {\n        [\"Kick\"] = true,\n        [\"Spear Hand Strike\"] = true,\n        [\"Pummel\"] = true,\n        [\"Wind Shear\"] = true,\n        [\"Solar Beam\"] = true,\n        [\"Skull Bash\"] = true,\n        [\"Counter Shot\"] = true,\n        [\"Silencing Shot\"] = true,\n        [\"Strangulate\"] = true,\n        [\"Mind Freeze\"] = true,\n        [\"Nether Shock\"] = true,\n        [\"Counterspell\"] = true,\n        [\"Rebuke\"] = true,\n        [\"Spell Lock\"] = true,\n        [\"Shadow Lock\"] = true,\n        [\"Optical Blast\"] = true,\n        [\"Silence\"] = true,\n        [\"Deadly Throw\"] = nil, --change to true & reload ui to enable tracking\n        [\"Arcane Torrent\"] = nil --ditto\n    }\n    \n    local WA_INTERRUPT_FUNC =  function(isInterrupt)\n        WA_INTERRUPT_SPELL = spellName\n        WA_INTERRUPT_TARGET = destName or \"Unknown\"\n        if isInterrupt then\n            WA_INTERRUPT_SUCCESS = true\n            WA_INTERRUPT_TARGETSPELL = extraSpellName or \"???\"\n        end\n        return true\n    end\n    \n    --interrupt spell casted; fires WA regardless of whether it interrupted something\n    if subevent == \"SPELL_CAST_SUCCESS\" and WA_INTERRUPT_SPELLS[spellName] and string.lower(WA_INTERRUPT_NAME) == string.lower(sourceName)  then\n        return WA_INTERRUPT_FUNC()\n    end\n    \n    --something was successfully interrupted\n    if subevent == \"SPELL_INTERRUPT\" and sourceGUID and WA_INTERRUPT_SPELLS[spellName] then \n        \n        --successful kick from a group member or the player\n        if string.sub(sourceGUID, 0, 6) == \"Player\" then\n            if string.lower(WA_INTERRUPT_NAME) == string.lower(sourceName) then\n                return WA_INTERRUPT_FUNC(true)\n            end\n            return\n        end\n        \n        --successful kick from a pet\n        if string.sub(sourceGUID, 0, 3) == \"Pet\" then\n            \n            --players own pet\n            if string.lower(UnitName(\"player\")) == string.lower(WA_INTERRUPT_NAME) then\n                if UnitGUID(\"playerpet\") == sourceGUID then\n                    return WA_INTERRUPT_FUNC(true)\n                end\n                return\n            end\n            \n            --check if its a group members pet\n            local s = UnitInRaid(\"player\") and \"raid\" or UnitInParty(\"player\") and \"party\" or nil\n            for i = 1, GetNumGroupMembers() - (s == \"party\" and 1 or 0) do\n                --successful kick from a group members pet + the player's pet if it's a raid\n                if string.lower(UnitName(s..i)) == string.lower(WA_INTERRUPT_NAME) then\n                    if UnitGUID(s..i..\"pet\") == sourceGUID then\n                        return WA_INTERRUPT_FUNC(true)\n                    end\n                    return\n                end\n            end\n        end\n    end\nend",
