			["displayText"] = "%c",
			["customText"] = "function()\n    \n    \n    for i=1, 40 do\n        if UnitExists(\"raid\"..i) and UnitIsVisible(\"raid\"..i) then\n            --local name, rank, icon, count, dispelType, duration, expires, caster, isStealable, shouldConsolidate, spellID, canApplyAura, isBossDebuff, value1, value2, value3 = UnitDebuff(\"raid\"..i, \"Unfathomable Reality\") \n            local value1 = UnitPower(\"raid\"..i, SPELL_POWER_ALTERNATE_POWER)\n            \n            local sleeping = UnitDebuff(\"raid\"..i, \"Dream Simulacrum\") and true or false\n            \n            local name = UnitName(\"raid\"..i)\n            \n            \n            if name and value1 then\n                aura_env.data[name] = {\n                    [sleeping and \"asleep\" or \"awake\"] = value1 or 0,\n                    [\"sleeping\"] = sleeping,\n                }\n            end\n            \n            \n            \n            \n        end\n    end\n    \n    local data = {}\n    for k,v in pairs(aura_env.data) do data[#data+1] = { [\"name\"] = k, [\"asleep\"] = v.asleep, [\"awake\"] = v.awake, [\"sleeping\"] = v.sleeping } end\n    \n    --[[\n    data = {\n        {    [\"name\"] = \"Pottm\", [\"sleeping\"] = true, [\"awake\"] = 20, [\"asleep\"] = 33 },   \n        {            [\"name\"] = \"PottM\", [\"sleeping\"] = false, [\"awake\"] = 40, [\"asleep\"] = 66 },\n        {           [\"name\"] = \"player\", [\"sleeping\"] = true, [\"awake\"] = 0, [\"asleep\"] = 57 },\n        {            [\"name\"] = \"Pottm\", [\"sleeping\"] = true, [\"awake\"] = 3, [\"asleep\"] = 33 },\n    }]]\n    \n    table.sort(data, function(a, b) return (a.sleeping and a.asleep or a.awake) > (b.sleeping and b.asleep or b.awake)  end)\n    \n    \n    \n    \n    local ret = \"\"\n    for i=1, #data do\n        local d = data[i]\n        --            ret = string.format(\"%s\\n|c%s%-12s|r %s\", \n        ret = string.format(\"%s\\n|c%s%s|r %s\", \n            ret, \n            RAID_CLASS_COLORS[select(2, UnitClass(d.name))].colorStr,\n            d.name,\n            d.sleeping and (\"|cff00ffff\" .. (d.asleep or \"?\") .. \"|r (\" .. (d.awake or \"?\") .. \")\") or (d.awake or \"?\")\n        )\n    end\n    \n    \n    return ret\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
