			["xOffset"] = -194.5,
			["displayText"] = "%c",
			["customText"] = "-- Insanity Bar -- By Twintop - Illidan-US, 2016/07/28\nfunction()\n    \n    local haste = UnitSpellHaste(\"player\");\n    local _, _, _, liCount, _, liDuration, _, _, _, _, liSpellId = UnitBuff(\"player\",GetSpellInfo(197937));\n    \n    if WA_Insanity_getRemainingTimeAndStackCount ~= nil then\n        local remainingTime, stackCount, moreStacks = WA_Insanity_getRemainingTimeAndStackCount();        \n        \n        WA_Insanity_Bar_Color_Text_Left = WA_Insanity_Bar_Color_Text_Left or \"00FFFFFF\";\n        \n        if stackCount == 0 and moreStacks == 0 then\n            if liCount ~= nil and liCount > 0 then\n                return string.format(\"|c%s%.2f%%%% - %.0f LI\", WA_Insanity_Bar_Color_Text_Left, haste, liCount);\n            else\n                return string.format(\"|c%s%.2f%%%%\", WA_Insanity_Bar_Color_Text_Left, haste);\n            end            \n        elseif stackCount == 100 then\n            return string.format(\"|c%s%.2f%%%% - %.0f VF\", WA_Insanity_Bar_Color_Text_Left, haste, stackCount);\n        else\n            return string.format(\"|c%s%.2f%%%% - %.0f (+%.0f) VF\", WA_Insanity_Bar_Color_Text_Left, haste, stackCount, moreStacks);\n        end    \n        \n    else\n        \n        if stackCount == 0 and moreStacks == 0 then\n            if liCount ~= nil and liCount > 0 then\n                return string.format(\"|c%s%.2f%%%% - %.0f LI\", WA_Insanity_Bar_Color_Text_Left, haste, liCount);\n            else\n                return string.format(\"|c%s%.2f%%%%\", WA_Insanity_Bar_Color_Text_Left, haste);\n            end            \n        else\n            return \"\";\n        end\n        \n    end\nend",
