			["untrigger"] = {
				["custom"] = "-----------------------------------------------------------------------\n--- Spinalcrack's Average Kill Time Weakaura -- www.howtopriest.com ---\n-----------------------------------------------------------------------\n\nfunction(e, ...)\n    \n    local encounterID = select(1, ...)\n    local encounterNAME = select(2, ...)\n    local difficultyID = select(3, ...)\n    local raidSize = select(4, ...)\n    local endStatus = select(5, ...)\n    local charName = UnitName(\"player\")\n    local charRealm = GetRealmName(\"player\")\n    local uName = charName..\"_\"..charRealm\n    local wipeORwin = 1000 --initializing\n    local tempTableFill = 0\n    \n    if endStatus == 0 then\n        wipeORwin = \"Wipe\" \n    elseif endStatus == 1 then \n        wipeORwin = \"Success\"\n    end\n    \n    -- Enable and load all the encounter IDs in intit if you want to output ie Heroic 25\n    --for i=0,15 do\n    --   if difficultyID == i then    \n    --        difficultyID = load_EncounterDiffID[i]\n    --    end\n    --end\n    \n    if e == \"ENCOUNTER_START\" then\n        return false\n        \n    elseif e == \"ENCOUNTER_END\" then\n        if select(5, ...) == 0 then \n            print(select(2, ...)..\" has ended...\")\n            return true\n        else\n            \n            -- none saved, and no active table --\n            if WeakAurasSaved['displays']['Average_Kill_Time']['Kill_Info'] == nil and store_EncounterID == nil then\n                store_EncounterID = {}  -- create an active table\n                \n                -- Saved table, but no active table --    \n            elseif WeakAurasSaved['displays']['Average_Kill_Time']['Kill_Info'] ~= nil and store_EncounterID == nil then\n                \n                store_EncounterID = {} -- create an active table and load the whole saved table into the active table --\n                store_EncounterID = WeakAurasSaved['displays']['Average_Kill_Time']['Kill_Info']\n                \n                \n                -- No saved table, but active table --\n            elseif WeakAurasSaved['displays']['Average_Kill_Time']['Kill_Info'] == nil and store_EncounterID ~= nil then\n                \n                ----** Nothing to do here, but wanted this logic in place to keep everything straight **----\n                \n                -- Saved table and active table --\n            elseif WeakAurasSaved['displays']['Average_Kill_Time']['Kill_Info'] ~= nil and store_EncounterID ~= nil then\n                \n                -- merge the tables --\n                for k,v in ipairs(WeakAurasSaved['displays']['Average_Kill_Time']['Kill_Info']) do table.insert(store_EncounterID, v) end \n                \n            end\n            \n            -- Check the active table, key by key and create new rows if nil --\n            if store_EncounterID[encounterID] ~= nil then \n                if store_EncounterID[encounterID][encounterNAME] ~= nil then\n                    if store_EncounterID[encounterID][encounterNAME][difficultyID] ~= nil then\n                        if store_EncounterID[encounterID][encounterNAME][difficultyID][uName] ~= nil then  \n                            -- Data already active -- this is a repeat kill --                                \n                        else\n                            store_EncounterID[encounterID][encounterNAME][difficultyID][uName] = {}\n                            store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"] = {}\n                            store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"average_KT\"] = {}   \n                        end\n                    else\n                        store_EncounterID[encounterID][encounterNAME][difficultyID] = {}\n                        store_EncounterID[encounterID][encounterNAME][difficultyID][uName] = {}\n                        store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"] = {}\n                        store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"average_KT\"] = {}   \n                    end\n                else\n                    store_EncounterID[encounterID][encounterNAME] = {}\n                    store_EncounterID[encounterID][encounterNAME][difficultyID] = {}\n                    store_EncounterID[encounterID][encounterNAME][difficultyID][uName] = {}\n                    store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"] = {}\n                    store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"average_KT\"] = {}    \n                end\n            else\n                store_EncounterID[encounterID] = {} \n                store_EncounterID[encounterID][encounterNAME] = {}\n                store_EncounterID[encounterID][encounterNAME][difficultyID] = {}\n                store_EncounterID[encounterID][encounterNAME][difficultyID][uName] = {}\n                store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"] = {}\n                store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"average_KT\"] = {}    \n            end\n            \n            -- Sort the newly formed table kill times --\n            table.sort(store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"])\n            \n            -- if there are kill times, check for duplicates and if found leave one entry and fill the rest with current time\n            for p=1,10 do\n                if store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][p] ~= nil then\n                    if p >=2 then\n                        local tempP = (p-1)\n                        if store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][p] == store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][tempP]then\n                            for q=p,10 do\n                                store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][q] = wa_gct_noFormat    \n                            end\n                            tempTableFill = 1\n                            p=10\n                        end\n                        \n                    end\n                    \n                end\n                \n                \n            end\n            \n            \n            -- if there are no kill times fill the table with this kill time\n            -- if there are kill times, add this kill time, sort the table, remove the longest kill time\n            -- then average the 10 kill times and assign to the global\n            for i=1,10 do          \n                if store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][i] ~= nil then\n                    \n                    if tempTableFill == 0 then store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][11] = wa_gct_noFormat end\n                    table.sort(store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"])\n                    store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][11] = nil\n                    \n                    local tempAvg = 0\n                    \n                    for j=1,10 do\n                        tempAvg = tempAvg + store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][j]\n                        if j == 10 then global_AverageKT = (tempAvg/10) end\n                        \n                    end                \n                    \n                    if tempTableFill == 0 then break end\n                    \n                else\n                    store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"kill_Times\"][i] = wa_gct_noFormat\n                    global_AverageKT = wa_gct_noFormat\n                    \n                end            \n            end\n            \n            \n            -- store average kill time in the table\n            store_EncounterID[encounterID][encounterNAME][difficultyID][uName][\"average_KT\"] = global_AverageKT\n            \n            -- Save the kill time table to weakauras variable\n            WeakAurasSaved['displays']['Average_Kill_Time']['Kill_Info'] = store_EncounterID\n            \n            \n            print(encounterNAME..\" has ended...\")\n            print(\"Time spent fighting \"..encounterNAME..\": \"..wa_global_combatTime)\n            print(\"New Average Kill Time: \"..(string.format(\"%02d:%02d\", global_AverageKT/60,  global_AverageKT%60)))\n            \n            if endStatus == 0 then print(\"RESET\") end\n            \n            global_wa_STM_GO = 0 -- shut down STM glow warning\n            \n            return true\n        end\n        \n    end\n    \nend",
